import moment from "moment";




export default function Calendar() {
  const weekdayshort = moment.weekdaysShort();
  let weekday = this.weekdayshort.map((day) => {
    return (
      <th key={day} className="week-day">
        {day}
      </th>
    );
  });

  return (
    <div>
      <h2>Calendar</h2>
    </div>
  );
}
